  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Program Service Reports provide information
  on reported demographics, services, and federal monitoring of Head Start and Early
  Head Start programs, beginning with the 2011-12 program year.</p>n<p>A Program Service
  Report includes Head Start Services Snapshots (from the PIR) and Monitoring Review
  Reports.</p>n<p>The Services Snapshots summarize annual Program Information Report
  (PIR) data on demographics and services provided and reported by grantees and delegates
  for the Head Start and the Early Head Start programs.</p>n<p>Monitoring Review Reports
  summarize the results of monitoring reviews that assess grantee compliance with
  requirements governing Head Start programs, including those specified in the Head
  Start Act and all applicable performance standards and regulations.</p>n\",\n\t\"license_title\":
